svg.desc:
# Generated by mscgen_js - https://sverweij.github.io/mscgen_js
msc {
  hscale="2",
  arcgradient="20";

  client1 [linecolor="black", textbgcolor="#FFFFCC",
arclinecolor="red"],
  relay [linecolor="black", textbgcolor="#FFFFCC", arclinecolor="red"],
  client2 [linecolor="black", textbgcolor="#FFFFCC",
arclinecolor="red"],
  trustee1 [linecolor="black", textbgcolor="#FFFFCC",
arclinecolor="red"],
  webserver [linecolor="black", textbgcolor="#FFFFCC",
arclinecolor="red"];

  --- [label="ON HOLD (0 client, M trustees)", linecolor="grey",
textbgcolor="white"];

  relay note relay [label="waiting for 1 client"];

  client1 => relay [label="TCP_SYN", linecolor="gray", textcolor="gray"];
  relay => client1 [label="TCP_SYNACK", linecolor="gray", textcolor="gray"];
  client1 => relay [label="TCP_ACK", linecolor="gray", textcolor="gray"];
  client1 => relay [label="HELLO(publicKey)"];
  --- [label="RESYNC", linecolor="grey", textbgcolor="white"];

  relay => trustee1 [label="TCP_SYN", linecolor="gray", textcolor="gray"];
  trustee1 => relay [label="TCP_SYNACK", linecolor="gray", textcolor="gray"];
  relay => trustee1 [label="TCP_ACK", linecolor="gray", textcolor="gray"];
  relay => trustee1 [label="SETUP(client_list)"];

  relay => client1 [label="ADVERTISE(trustees_pk_list)"];
  client1 => relay [label="SCHEDULE(ephemeral pk)"];

  relay => trustee1 [label="DO_SHUFFLE(public keys, base)"];
  trustee1 => relay [label="DONE_SHUFFLE(public keys, base)"];

  relay => trustee1 [label="VERIFY_SHUFFLE(transcript)"];
  trustee1 => relay [label="SHUFFLE_OK(sig)"];

  relay => client1 [label="END_SCHEDULE(schedule, trustees sigs)"];
  |||;
  --- [label="COMMUNICATING (1 client, M trustees)", linecolor="grey",
textbgcolor="white"];
  trustee1 => relay [label="COVER_TRAFFIC", linecolor="blue", textcolor="blue"],
  client1 => relay [label="DATA_UP", linecolor="blue", textcolor="blue"];
  relay => webserver [label="HTTP request", linecolor="orange", textcolor="orange"];
    relay => client1 [label="DATA_DOWN (empty)", linecolor="green", textcolor="green"];

  ...;

trustee1 => relay [label="COVER_TRAFFIC", linecolor="blue", textcolor="blue"],
  client1 => relay [label="DATA_UP", linecolor="blue", textcolor="blue"];
    webserver => relay [label="HTTP answer", linecolor="orange", textcolor="orange"];
  relay => client1 [label="DATA_DOWN (http data)", linecolor="green", textcolor="green"];

  ...;
  --- [label="(new client)", linecolor="grey", textbgcolor="white"];
  client2 => relay [label="TCP_SYN", linecolor="gray", textcolor="gray"];
  relay => client2 [label="TCP_SYNACK", linecolor="gray", textcolor="gray"];
  client2 => relay [label="TCP_ACK", linecolor="gray", textcolor="gray"];
  ...;
  trustee1 => relay [label="COVER_TRAFFIC", linecolor="blue", textcolor="blue"],
  client1 => relay [label="DATA_UP", linecolor="blue", textcolor="blue"];
  relay => client1 [label="DATA_DOWN", linecolor="green", textcolor="green"],
  client2 => relay [label="HELLO(publicKey)"];
  --- [label="RESYNC", linecolor="grey", textbgcolor="white"];

  trustee1 => relay [label="COVER_TRAFFIC", linecolor="blue", textcolor="blue"],
  client1 => relay [label="DATA_UP", linecolor="blue", textcolor="blue"];
  relay => client1 [label="DATA_DOWN(resync_on)", linecolor="green", textcolor="green"];
  client1 => relay [label="HELLO(new publicKey)"];
  --- [label="RESYNC", linecolor="grey", textbgcolor="white"];

  relay => trustee1 [label="TCP_SYN", linecolor="gray", textcolor="gray"];
  trustee1 => relay [label="TCP_SYNACK", linecolor="gray", textcolor="gray"];
  relay => trustee1 [label="TCP_ACK", linecolor="gray", textcolor="gray"];
  relay => trustee1 [label="SETUP(client_list)"];

  relay => client1 [label="ADVERTISE(trustees_pk_list)"],
  relay => client2 [label="ADVERTISE(trustees_pk_list)"];
  client1 => relay [label="SCHEDULE(ephemeral pk)"],
  client2 => relay [label="SCHEDULE(ephemeral pk)"];

  relay => trustee1 [label="DO_SHUFFLE(public keys, base)"];
  trustee1 => relay [label="DONE_SHUFFLE(public keys, base)"];

  relay => trustee1 [label="VERIFY_SHUFFLE(transcript)"];
  trustee1 => relay [label="SHUFFLE_OK(sig)"];

  relay => client1 [label="END_SCHEDULE(schedule, trustees sigs)"],
  relay => client2 [label="END_SCHEDULE(schedule, trustees sigs)"];
  |||;
  --- [label="COMMUNICATING (2 client, M trustees)", linecolor="grey",
textbgcolor="white"];
  trustee1 => relay [label="COVER_TRAFFIC", linecolor="blue", textcolor="blue"];
  client1 => relay [label="DATA_UP", linecolor="blue", textcolor="blue"],
  client2 => relay [label="DATA_UP", linecolor="blue", textcolor="blue"];
  relay => client1 [label="DATA_DOWN", linecolor="green", textcolor="green"],
  relay => client2 [label="DATA_DOWN", linecolor="green", textcolor="green"];
  ...;
  --- [label="ERROR", linecolor="grey", textbgcolor="white"];

  trustee1 => relay [label="COVER_TRAFFIC", linecolor="blue", textcolor="blue"];
  client1 -X relay [label="DATA_UP", linecolor="blue", textcolor="blue"],
  client2 => relay [label="DATA_UP", linecolor="blue", textcolor="blue"];

  relay note relay [label="timeout"];
  ...;
  relay => client2 [label="DATA_DOWN(resync_on)", linecolor="green", textcolor="green"];
  client2 => relay [label="HELLO(new publicKey)"];
  --- [label="RESYNC", linecolor="grey", textbgcolor="white"];
  ...;
}
